import React from "react";

const SummaryItem = ({ countryInfo }) => {
  console.log("COUNTRY ID", countryInfo.id);
  return (
    <div className="summaryItem">
      <h3>{countryInfo.country}</h3>
      <iframe
        src={`https://open.spotify.com/embed/track/${countryInfo.id}`}
        width="90%"
        height="380"
        frameborder="0"
        allowtransparency="true"
        allow="encrypted-media"
      ></iframe>
      ;
    </div>
  );
};

export default SummaryItem;
